import React from 'react';
import classes from './card.module.css';
import img from '../../assets/oa.jpeg'
const Card = props => {
    const data = props.data;
    return <div className={classes.Card}>
        <img src={img}/>
        <h3>{data.id}</h3>
        <p>{data.name}</p>
        <p>{data.currency}</p>
    </div>
}

export default Card;
